function Note(props) {
  function handleClick(item) {
   if(!item.completed){
     item.completed = true;
  }
  }
console.log("props",props.note);
  return (
    <div className="note">
          {  props.note.map((item) => {
        
         return <ul> <li onClick={() => {handleClick(item)}}>{item.title}</li></ul>
            
      

       
      })}
      
    </div>
  );
}

export default Note;
